  [],\n\t\"revision_timestamp\": \"2016-07-27T22:19:27.997091\",\n\t\"name\": \"walnut-creek-watershed-restoration-and-water-quality-monitoring-project\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The primary objective of this project is
  to establish a nonpoint source monitoring program in relation to the watershed habitat
  restoration and agricultural management changes implemented by the Walnut Creek
  National Wildlife Refuge and Prairie Learning Center (WNT). The WNT watershed is
  being restored to native prairie and/or savanna; riparian zones and wetlands will
  be restored in context, with riparian zones grading from prairie waterways, to savanna,
  to timbered stream borders.  The general goal of this project is: to institute a
  comprehensive, long-term, 319-NPS protocol monitoring project in the Walnut Creek
  Watershed, Jasper County, Iowa and to quantitatively document overtime the reduction
  in non-point source pollution and environmental improvements resulting from watershed
  habitat restoration and land management changes implemented by WNT.\",\n\t\"license_title\":
